&lt;p&gt;
	The approach is to measure ExB drifts (through electric field observations) in conjunction with E and F region turbulence observations.&lt;/p&gt;
&lt;p&gt;
	This will be accomplished via a twin rocket launch from Kwajalein. The two rockets would have apogees of 200 and 350 km so measurements will be made simultaneously in the E and F-region. and will be instrumented to determine&lt;/p&gt;
&lt;ul&gt;
	&lt;li&gt;
		DC and AC electric fields&lt;/li&gt;
	&lt;li&gt;
		the plasma density and its structures,&lt;/li&gt;
	&lt;li&gt;
		the spectral properties of ionospheric E and F region irregularities.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;
	The rocket measurements will be complemented by a comprehensive array of ground-based instruments including interferometric coherent scatter radar observations and GPS and ionosonde data. Neutral winds will be determined from chemical release trails.&lt;/p&gt;
